import { createApp } from 'vue'
import App from './App.vue'

createApp(App).mount('#app')
import {post} from "@/utils/http"
post("/user/login",{
    "createTime": "",
    "id": 0,
    "password": "admin",
    "permissions": 0,
    "updateTime": "",
    "username": "admin"
}).then(res=>{
    console.log(res);
}).catch(err=>{
    console.log(err);
})
